func (d *Dialer) DialContext(ctx context.Context, uri string) (*Conn, error) {
	c, rsp, err := d.Dialer.DialContext(ctx, uri, nil)
	if err != nil {
		return nil, fmt.Errorf("gremlin: dialing uri %s: %w", uri, err)
	}
