func (efaceDecoder) reflectMap(data []byte) (reflect2.Type, error) {
	var key, elem any
	if err := Unmarshal(
		bytes.Replace(data, []byte(mapType), []byte(listType), 1),
		&[...]*any{&key, &elem},
	); err != nil {
		return nil, fmt.Errorf("cannot unmarshal first map item: %w", err)
